   (	ACTIONTYPEID CHAR(5), 
	ALIAS VARCHAR(25)	NOT NULL, 
	NAME VARCHAR(50)	NOT NULL, 
	DESCRIPTION VARCHAR(255), 
	SYSTEMGENERATED CHAR(1),
	CONSTRAINT PK_TBLSACTIONTYPE PRIMARY KEY (ACTIONTYPEID)
   ) ;
      
--------------------------------------------------------
--  DDL for Table TBLMACTION
--------------------------------------------------------

  CREATE TABLE TBLMACTION 
   (	ACTIONID CHAR(8), 
	NAME VARCHAR(100)		NOT NULL, 
	ALIAS VARCHAR(50)		NOT NULL, 
	DESCRIPTION VARCHAR(255), 
	ACTIONTYPEID CHAR(5)		NOT NULL, 
	PARENTACTIONID CHAR(8), 
	ACTIONLEVEL NUMERIC(2,0)		NOT NULL, 
	SYSTEMGENERATED CHAR(1)		NOT NULL, 
	SCREENID CHAR(6), 
	STATUS CHAR(1), 
	FREEZEPROFILE CHAR(1),
	CONSTRAINT PK_MACTION PRIMARY KEY (ACTIONID),
	CONSTRAINT FK1_MACTION FOREIGN KEY (SCREENID)  REFERENCES TBLSSCREEN (SCREENID), 
	CONSTRAINT FK2_MACTION FOREIGN KEY (PARENTACTIONID) REFERENCES TBLMACTION (ACTIONID),
	CONSTRAINT FK3_MACTION FOREIGN KEY (ACTIONTYPEID)  REFERENCES TBLSACTIONTYPE (ACTIONTYPEID)
   ) ;
